pattern Address_Purpose_PRIVATESERVICECONNECT = Address_Purpose "PRIVATE_SERVICE_CONNECT"

-- | A regional internal IP address range reserved for Serverless.
pattern Address_Purpose_Serverless :: Address_Purpose
